import React from 'react';
import { FieldProps } from 'formik';
import TextField from '@material-ui/core/TextField';

interface Props extends FieldProps {
  placeholder: string;
  label: string;
  size?: string;
}

export const MyTextField: React.FC<Props> = ({
  label,
  placeholder,
  field,
  size,
}) => {
  return (
    <TextField
      size={size}
      fullWidth
      variant="outlined"
      label={label}
      placeholder={placeholder}
      {...field}
    />
  );
};
